//switch the turns
void diffSwitch(int curr2){
	if(curr2 != temp2){
		player = !player;
		temp2 = curr2;
	}
}

//delay counter
void delay(int n) {
	int count = 0;
	for (int i = 0; i < n; i++) {
		count++;
		if (count == n) {
			return;
		}
	}
}

//plot the pixel
void plot_pixel(int x, int y, short int colorP) {
	volatile short int *one_pixel_address;
	one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1); //base + x and y offset
	*one_pixel_address = colorP;
}

//v_sync, pointer of front and back buffer are swapped
void wait_for_vsync() {
  int status;
  *pixel_ctrl_ptr = 1; //syn started and 1 into the buffer address reg
  status = *(pixel_ctrl_ptr + 3); //read the status reg
  while ((status & 0x01) != 0) { //polling for S bit to go to 0
	  status = *(pixel_ctrl_ptr + 3); //will exit when bit goes to 0
  }
}

//clear screen
void clear_screen() { //by plotting black
	for (int i = 0; i < 320; i++) {
		for (int j = 0; j < 240; j++){
			plot_pixel(i,j, 0);
		}
	}
}

//swap x and y by reference
void swap(int* a, int* b) {
    int temp = *a;
    *a = *b;
    *b = temp;
}

//playing audio sounds
void audio_playback_mono(int *samples, int n) {
	int count = 0;
	audiop->control = 0x8; // clear the output FIFOs
    audiop->control = 0x0; // resume input conversion
    while (count< n) {
    	// output data if there is space in the output FIFOs
        if ((audiop->wsrc != 0) && (audiop->wslc != 0)) {
        	audiop->ldata = samples[count];
            audiop->rdata = samples[count++];
       	}
	}
}	

